} impl SieveOfEratosthenes { fn new(v: usize) -> Self { let mut is_prime = vec![true; v + 1]; let mut primes = vec![]; for i in 2..=v { if is_prime[i] { primes.push(i as u64); for j in ((i * i)..=v).step_by(i) { is_prime[j] = false; } } } Self { primes } } fn factorize(&self, mut x: u64) -> Vec<(u64, u64)> { assert!(x > 1); let mut res = vec![]; for &p in self.primes.iter() { let mut exp = 0; while x % p == 0 { exp += 1; x = x / p; } if exp > 0 { res.push((p, exp)) } if p * p > x { break; } } if x > 1 { res.push((x, 1)); } res }
