定義 Windy 數為該數的數字（不含 leading 0）與數字之間差至少 2，問 $[a, b]$ 之間有多少 Windy 數？ 如同上一題，我們轉換題目為求 $f(K)$ = $[0, K]$ 之間有多少數是 Windy 數。不同的是我們不只記錄前一位是否是 2，而是記錄前一位的數字是什麼。 設 $dp[i, p, f]$ = number of valid ways to fill $x_{i - 1} \cdots x_1 x_0$ and $x_{i - 1} = p$ $(f = 0): x_{i-1} \cdots x_1 x_0 \le k_{i-1} \cdots k_1 k_0$ $(f = 1): x_{i-1} \cdots x_1 x_0 \gt k_{i-1} \cdots k_1 k_0$ 如果我們直接使用上一題的邏輯來遞推轉移會發現答案是錯的！這是因為 digit dp 將數字視為有 leading zero 的，例如 $K = 1234$ 時，$36$ 會被視為 $0036$ 在處理。這個特性在上一題並不影響答案，但這題會。$0036$ 是 Windy 數但 digit dp 會將之視為不是，因為他有 $00$ 不滿足數字差至少為 2，因此我們得修改我們的 dp。 關於這種情況有不少種解法，而我的解法是將 leading zero 用另一個字元 $\bullet$ 代替，將之與數字中間的 0 分開。例如 $36$ 會被視為 $\bullet \bullet 36$。而 $103$ 會被視為 $\bullet103$。 當我們枚舉 $x_i$ 時，我們用以下規則來確保製造出合法的 Windy 數： 若 $x_{i - 1}$ 是 $\bullet$，則 $x_i$ 必得填 $\bullet$，因為 leading zero 出現，其左邊都得是 leading zero。 若 $x_{i - 1}$ 是 0，則 $x_i$ 不可填 $\bullet$，因為 0 不可位於數的開頭。 若 $x_{i - 1}$ 是其他數字時，則 $x_i$ 可以填 $\bullet$ 也可以填其他數字，只要滿足題意。 僅當這些規則成立時，這才是一個有效的 $x_i$，此時才遞推轉移： $$ \text{if } (1) \land (2) \land (3) \text{, then } dp[i, p, f] \to dp[i + 1, x_i, f'] $$ $f'$ 的計算跟之前稍為不同，$f'$ 代表的是 $x_i x_{i-1} \cdots x_1 x_0 \gt k_i k_{i-1} \cdots k_1 k_0$ 成立與否。如果 $x_i$ 填 $\bullet$ 的話，則式子必不成立，即 $f' = 0$。因此 $f' = 1$ 的情況是 $((x_i \gt k_i) \lor (x_i = k_i \land f = 1)) \land (x_i \ne \bullet)$。 而 $f(K)$ 就是 $dp[N, \bullet, 0] + \sum_{p = 1}^9 dp[N, p, 0]$，注意到 $dp[N, 0, 0]$ 並不是答案一部份，因為現在數字不會以 0 開頭。實作上我將 $\bullet$ 用值 10 代替。 for (int i = 1; i < N; i++) { for (int p = 0; p < 11; p++) { // x[i - 1] for (int f = 0; f <= 1; f++) { for (int d = 0; d < 11; d++) { // x[i] bool valid = false; if (p == 0) { valid = (2 <= d && d <= 9); } else if (p == 10) { valid = (d == 10); } else { valid = (abs(p - d) >= 2 || d == 10); } if (valid) { int new_f = (d > k[i] || (d == k[i] && f == 1)) && (d != 10); dp[i + 1][d][new_f] += dp[i][p][f]; } } } }
} int res = 0;
for (int p = 1; p < 11; p++) { res += dp[N][p][0];
}

