// a.div_euclid(b) is the same as floor(a/b)
fn floor_div(a: i64, b: i64) -> i64 { a.div_euclid(b)
} // Add 1 to floor(a/b) if needed
fn ceil_div(a: i64, b: i64) -> i64 { a.div_euclid(b) + if a.rem_euclid(b) != 0 { 1 } else { 0 }
} if we need to implement euclidean division ourself: // euclidean_div is the same as floor_div.
// The remainder is always >= 0.
// a/b (b > 0) rounds toward zero.
// when a < 0, we left shift the value if needed.
// when a >= 0, a/b is what we want.
fn euclidean_div(mut a: i64, mut b: i64) -> (i64, i64) { if b < 0 { a = -a; b = -b; } let mut q = a / b; if q < 0 && a % b != 0 { q -= 1; } (q, a - b * q)
} fn floor_div(a: i64, b: i64) -> i64 { let (q, r) = euclidean_div(a, b); q
} fn ceil_div(a: i64, b: i64) -> i64 { let (q, r) = euclidean_div(a, b); q + if r != 0 { 1 } else { 0 }
} ABC334B ABC334B

